(10159,77554,'',1,'Atendimento','Solicitar acesso à cópia integral do processo administrativo referente a um pedido de aposentadoria que foi indeferido há alguns anos.\r\n\r\nNa época, o requerimento e a entrega dos documentos foram realizados de forma física na agência do INSS, motivo pelo qual o requerente não possui mais cópia dos documentos apresentados.\r\n\r\nRessalto que, ao realizar contato telefônico pelo número 135 e também presencialmente em agência, não foi possível localizar o número do protocolo ou processo administrativo referente a esse pedido antigo, constando como inexistente no sistema apesar de constar no CNIS.\r\n\r\nDessa forma, solicito, por gentileza, um atendimento ou orientação específica para localização e obtenção da cópia desse processo administrativo, uma vez que ela é essencial para instruir um novo pedido de aposentadoria.\r\n\r\nColoco-me à disposição para fornecer dados adicionais que possam auxiliar na localização do processo, como nome completo, CPF, data de nascimento e eventuais datas aproximadas do requerimento.','2025-10-16','12:00:00','12:30:00','Confirmado',NULL,NULL,'Atendido','2025-10-09 17:59:33'),
