(10374,77536,'48998219848',1,'Atendimento','Foi implantado benefício judicialmente, porém não aparece no meuinss do cliente. Ao tentar abrir novo pedido de benefício por incapacidade, informou que precisa aguardar pois tem um em aberto \"Encontrado(s) requerimento(s) aberto(s) incompatível(is) no SIBE, NB(s) 7267037985. Para um novo requerimento, o(s) anterior(es) deve(m) ser concluído(s).\"  O cliente não pode ficar sem receber. Gostaria de ver o que houve internamente para que o benefício não conste como ativo, considerando que no processo judicial o INSS informou que está implantado. ','2025-12-15','12:00:00','12:30:00','Confirmado',NULL,NULL,'Não Compareceu','2025-12-11 14:09:58'),
