(10376,77624,'(48) 991039880',1,'Atendimento','INSS exigiu o seguinte:\r\n\r\n\"#### EXIGÊNCIA DO PPP\r\nSolicitamos cumprir a exigência em anexo referente ao PPP. Além disso, o INSS não aceita o Perfil Profissiográfico Previdenciário (PPP) em papel para períodos trabalhados a partir de 01/01/2023.\r\nPara esses casos, é obrigatório o uso do PPP Eletrônico.\r\nSituação atual: O Cadastro Nacional de Informações Sociais (CNIS) informa que não há PPP registrado para o seu vínculo, embora você tenha declarado exposição a agentes prejudiciais à saúde.\r\nO que você deve fazer: Entre em contato com seu empregador e solicite o envio das informações de saúde e segurança.\r\nDado técnico necessário: O empregador deve enviar o evento S-2240 pelo sistema eSocial.\"\r\n\r\nContudo, o trabalho a ser reconhecido foi anterior a 01/01/2023.','2025-12-17','08:30:00','09:00:00','Confirmado',NULL,NULL,'Atendido','2025-12-11 17:07:31'),
